style.css:
@-moz-document domain(casinotopsonline.com) {
.toplist-homepage .badge-container .toplist-badges.hot {
	background: #f98895;
	color: #000000;
	box-shadow: none;
}
.toplist-homepage .badge-container .toplist-badges.new {
	background: #f9c588;
	color: #000000;
	box-shadow: none;
}
.toplist-homepage .badge-container .toplist-badges.top {
	background: #f9e788;
	color: #000000;
	box-shadow: none;
}
.toplist-homepage .badge-container .toplist-badges.pay-n-play {
	background: #67dc7a;
	color: #0f2112;
}
.toplist-badges {
	border-radius: 2px;
}
.toplist-homepage .logo[data-id="badge-position-1"]:before, .toplist-homepage .logo[data-id="badge-position-2"]:before, .toplist-homepage .logo[data-id="badge-position-3"]:before {
	width: 3rem;
	height: 3rem;
	top: -1rem;
	left: -0.8rem;
	align-items: center;
}
.toplist-homepage .badge-container .toplist-badges {
	font-size: 1.2rem;
	height: 2.6rem;
}
.toplist-homepage .logo:before {
	border: none;
}
.toplist-homepage .logo[data-id="badge-position-3"]:before {
	background-color: #cd7f32;
	background-image: unset;
}
.toplist-homepage .logo[data-id="badge-position-2"]:before {
	background-color: #a8a8a8;
	background-image: unset;
}
.toplist-homepage .logo[data-id="badge-position-1"]:before {
	background-color: #dfc46c;
	background-image: unset;
}
.toplist-homepage .logo img {
	border-radius: 50%;
	border: none;
}
.toplist-homepage .toplist-homepage-inner .rating-wrapper .star-rating .star-on-png {
	color: #ffb03c;
}
.toplist-homepage.featured .toplist-homepage-inner .logo-info .rating-wrapper .toplist-text-rating {
	color: #312b16;
}
.toplist-homepage .toplist-homepage-inner .rating-wrapper .toplist-text-rating {
	align-items: baseline;
}
.toplist-homepage.featured .toplist-homepage-inner .logo-info .rating-wrapper .toplist-text-rating span.lower-score {
	font-size: 1rem;
}
.toplist-homepage .toplist-homepage-inner .rating-wrapper {
	padding: 0.8rem 0.8rem;
	background-color: #ffe4cf;
	border: none;
	border-radius: 0.4rem;
	min-width: unset;
	max-width: unset;
	max-height: 2.8rem;
	width: fit-content;
}
.btn-sm {
	width: auto;
	height: auto;
}
.toplist-homepage .toplist-footer .cta-wrapper .toplist-cta .btn-sm {
	padding: 1.6rem 2.4rem;
}
.btn-lg.play, .btn-sm.play {
	background-color: #84d65c;
	color: #1d390e;
	font-size: 1.6rem;
}
.toplist-homepage.featured .toplist-footer .toplist-cta .btn-lg {
	font-size: 1.7rem;
	font-weight: 600;
}
.btn-lg.play:hover, .btn-sm.play:hover {
	background-color: #a0e180;
}
.toplist-homepage.featured .toplist-homepage-inner {
	align-items: flex-start;
}
.toplist-homepage.featured .toplist-homepage-inner .info .link-cta, .toplist-homepage.featured .toplist-homepage-inner .logo-info .toplist-header .title-rating .toplist-title.h4 a, .toplist-homepage .toplist-homepage-inner .content-wrapper .link-cta, .toplist-homepage .toplist-homepage-inner .content-wrapper .info .toplist-title.h4 a {
	transition: color 0.3s ease-in-out;
	align-self: flex-start;
}
.toplist-homepage.featured .toplist-homepage-inner .info .link-cta:hover, .toplist-homepage.featured .toplist-homepage-inner .logo-info .toplist-header .title-rating .toplist-title.h4 a:hover, .toplist-homepage .toplist-homepage-inner .content-wrapper .link-cta:hover, .toplist-homepage .toplist-homepage-inner .content-wrapper .info .toplist-title.h4 a:hover {
	color: #555555;
}
@media(min-width: 768px) {
	.toplist-homepage.featured .toplist-homepage-inner .info {
		margin: 2.4rem 0;
		margin-left: 0.8rem;
	}
}
@media(min-width: 1200px) {
	.toplist.new-toplist .toplist-featured {
		grid-template-columns: 45rem 37rem 1fr;
	}
}
.toplist-homepage.featured .toplist-footer .toplist-oneliner, .toplist-homepage .toplist-footer .cta-wrapper .toplist-oneliner {
	margin-bottom: 0.8rem;
	color: rgb(76 76 76);
	font-size: 1.5rem;
	font-weight: 600;
	line-height: 1.9rem;
}
.toplist-homepage .toplist-footer .cta-wrapper .toplist-oneliner {
	margin: 0;
}
.toplist-homepage.featured .toplist-homepage-inner {
	padding: 0 2.4rem;
}
.toplist-homepage.featured {
	padding: 2.4rem 0 0;
	position: relative;
}
.toplist-homepage .tnc.centered {
	display:none;
}
.toplist-homepage.featured, .toplist-homepage {
	background-color: hsl(235deg 10% 98%);
}
.toplist-homepage.featured .toplist-footer, .toplist-homepage .toplist-footer, .toplist-homepage .toplist-footer .cta-wrapper {
	background-color: hsl(235deg 15% 95%);
}
li.toplist-row.toplist-homepage.featured:hover, .toplist-homepage:hover {
	box-shadow: 0 0 56px 0 rgb(0 0 0 / 12%);
}
li.toplist-row.toplist-homepage.featured, .toplist-homepage {
	transition: box-shadow 0.3s ease-in-out, background-color 0.3s ease-in-out;
}
.toplist-homepage.featured .toplist-homepage-inner .info {
	align-items: flex-start;
}
.toplist-homepage.featured .toplist-homepage-inner .info .toplist-selling-points li:before {
	border-radius: 50%;
	background-color: #84d65c;
	font-family: Fontello;
	font-size: 0.6rem;
	padding: 0.45rem;
	position: absolute;
	left: 0;
	color: #2a4e18;
}
.toplist-homepage.featured .toplist-homepage-inner .info .toplist-selling-points li {
	padding-left: 2.6rem;
	font-weight: 400;
	position: relative;
	display: flex;
	align-items: center;
	color: #555555;
	font-size: 1.5rem;
}

.toplist-homepage.featured .toplist-footer {
	padding: 1.6rem 0 2.4rem;
	display: flex;
	align-items: center;
	min-height: 10.2rem;
	flex-direction: column;
	justify-content: flex-end;
}
.module-toplist.homepage .view-more-btn {
	text-transform: none;
	display: flex;
	font-weight: 600;
	font-size: 1.8rem;
	justify-content: center;
	align-items: center;
	color: #4c4c4c;
	background-color: #ffffff;
	height: auto;
	width: auto;
	border: .2rem solid #4c4c4c;
	padding: 1.2rem 2.4rem;
	text-decoration: none;
	margin: 2.4rem auto 1.2rem;
	border-radius: 3px;
	transition: color 0.3s ease-in-out, background-color 0.3s ease-in-out;
}
.module-toplist.homepage .view-more-btn:hover {
	background-color: #4c4c4c;
	color: #fff;
}
}
